import React from "react";

import { Home } from '../home/home'

import "./login.css"

export class Login extends React.Component {

    constructor(props) {
        super(props);
        this.state = {email: ''};
        this.state = {password: ''};

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
      }

      handleChange(event) {
        this.setState({email: event.target.value});
        this.setState({password: event.target.value});
      }

      handleSubmit(event) {
        alert('A name was submitted: ' + this.state.email + this.state.password);
        event.preventDefault();
      }

    render() {
        return(
            <div className="loginSiteWrapper">
                <form className="loginFormWrapper" onSubmit={this.handleSubmit}>
                    <input className="loginFormInput" type="text" name="email" placeholder="email" email={this.state.email} onChange={this.handleChange}/>
                    <input className="loginFormInput" type="password" name="password" placeholder="password"  password={this.state.password} onChange={this.handleChange}/>

                    <button className="loginFormButton" type="submit" value="Submit"/>
                </form>
            </div>
        )
    }

}

export default Login;
